acapp.KpiModel = Backbone.Model.extend({
    //selected - is this button toggled on (selected) or off?
    //chartType - use this key to with ChartFactory to make corresponding chart.
    //chartTile - in case there's a full highcharts element in the button view
    //template - HTML template to be loaded into the controls div providing
    //kpi specific controls and views. 
    defaults: {
        id: acapp.KPI_DEFAULT,
        benchmarkDesc: "Same month PY:",
        chartType: acapp.KPI_DEFAULT,
        chartTile: null,
        format: "small", // || "large"
        inTarget: true,
        navButtonView: "template/defaultButton.html",
        priorPeriod: 0,
        ref: "chartDivClick",
        show: true, //Whether to initially show on overall dashboard
        section: null,
        selected: false,
        settingsTitle: null,
        targetKpi: false,
        template: "template/defaultCtrl.html"
    },
    initialize: function (options) {
        this.set("chartType", this.get("id"));
        this.set("inTarget", this.get("inTarget"));
    },
    show: function (onOff) {
        this.set("show", onOff);
    },
    toTemplateObject: function () {
        return {
            id: this.get("id"),
            benchmarkDesc: this.get("benchmarkDesc"),
            cat1Val: this.get("cat1Val"),
            cat2Val: this.get("cat2Val"),
            cat3Val: this.get("cat3Val"),
            chartType: this.get("chartType"),
            checked: ((this.get("show") === true) ? "checked" : ""),
            contextTitle: this.get("contextTitle"),
            currentMetric: this.get("currentMetric"),            
            navButtonId: "nav_" + this.get("chartType"),
            priorPeriod: this.get("priorPeriod"),
            section: this.get("section"),
            selected: this.get("selected"),
            settingsTitle: (this.get("settingsTitle") === null) ? this.get("title") : this.get("settingsTitle"),
            ref: this.get("ref"),
            title: this.get("title")
        };
    }
});

