/* Non-Backbone models */
acapp.FilterItem = function (id, text, children) {
    this.id = id;
    this.text = text;
    this.hasChildren = children;
}

acapp.FilterItem.prototype = {
    constructor: acapp.Filter,
    toString: function () {
        return this.id + ": " + this.text+", hasChildren="+this.hasChildren;
    }
}
